import styles from "./SkillsPage.module.scss";
import { SkillsList } from "../../components/SkillsList/SkillsList";

export const SkillsPage = () => {
  return (
      <div className={styles.skills}>
        <h2 className={styles.skills}>My Skills</h2>
        <SkillsList />
      </div>
  );
};
